INSERT INTO Projects (project_id,title,creator,img_src,description,start_date,end_date,goal,raised) VALUES (DEFAULT,'Lisa Frank Makeup Collaboration','luciusrichardson@commodoipsum.co.uk','https://s3-ap-southeast-1.amazonaws.com/cs2102jan17g11-crowdfundme/Lisa+Frank.png','We want to put the Lisa Frank iconic artwork on our high quality & cruelty-free makeup! Help bring this collab to life!','2015-06-21','2017-06-28',30000,15000);
INSERT INTO Projects (project_id,title,creator,img_src,description,start_date,end_date,goal,raised) VALUES (DEFAULT,'Malty the Bear','luciusrichardson@commodoipsum.co.uk','https://s3-ap-southeast-1.amazonaws.com/cs2102jan17g11-crowdfundme/Malty+the+bear.png','Artisanal Hot Cocoa blend inspired by malt shakes from the 1960s. Comes in adorable glass honey bears. Handcrafted in Brooklyn.','2015-03-03','2017-09-24',5000,1000);
INSERT INTO Projects (project_id,title,creator,img_src,description,start_date,end_date,goal,raised) VALUES (DEFAULT,'The Official Worlds Greatest Troll Sculpt','fayboyd@quamquis.net','https://s3-ap-southeast-1.amazonaws.com/cs2102jan17g11-crowdfundme/Troll+Sculpt.png','I am looking to fund the manufacturing of a large number of factory made vinyl Trump Troll dolls. The sculpture seems to have struck a very popular chord with my family and friends on Facebook.This figure is near and dear to me and thankfully it seems to have brought a smile to all sides of the political spectrum. The response has taken me a little by surprise!! I am very grateful to have made so many people happy with this sculpture. I want to make this figure widely available to everyone around the world that has taken a liking to my caricature sculpture and to do that I need your help to cover the costs of making the production molds and castings as well as the freight costs from the toy factory. I will cast and finish the resins figures here in my shop as soon as the goal is met and have them on the way to those at thatsupport level. The vinyl figures will be turned around as soon as I can get the factory on board and fulfilling the orders. I allowed a year for this under the Kickstarter protocol but I will do everything I can to make them available in a few months. The art is ready to go and its a matter of production of the pieces now. Thank you very much for your help in making this happen!','2016-06-03','2017-12-08',40000,2000);
INSERT INTO Projects (project_id,title,creator,img_src,description,start_date,end_date,goal,raised) VALUES (DEFAULT,'Jack by Podo Labs','fayboyd@quamquis.net','https://s3-ap-southeast-1.amazonaws.com/cs2102jan17g11-crowdfundme/Jack+headphones.png','This tiny device brings Bluetooth capability to all of your audio devices. It even lets you sync headphones with a friend!','2015-06-25','2017-12-14',30000,15000);
INSERT INTO Projects (project_id,title,creator,img_src,description,start_date,end_date,goal,raised) VALUES (DEFAULT,'BULLET','alisawilliams@nunc.org','https://s3-ap-southeast-1.amazonaws.com/cs2102jan17g11-crowdfundme/Bullet+flashlight.png','Waterproof, Fireproof, Small, Tough, and Bright. A Mini Multi-Use LED Light for EDC. Last year we introduced BULLET: Worlds Smallest LED Flashlight. We are back again, now with an even more minimal design, inspired by the iconic 40 S&W Luger round.BULLET 02 can be attached to virtually anything. Your gym bag, your jacket, your keys. Suitable for any indoor or outdoor situation.','2015-06-24','2017-05-08',20000,3000);
INSERT INTO Projects (project_id,title,creator,img_src,description,start_date,end_date,goal,raised) VALUES (DEFAULT,'The Shut Up & Sit Down Nonsense Box','alisawilliams@nunc.org','https://s3-ap-southeast-1.amazonaws.com/cs2102jan17g11-crowdfundme/Monikers+nonsense+box.png','This time, we have teamed up with the folks at Shut Up & Sit Down, the best board game site on the entire internet. They wrote 100% of this expansion, and the cards they came up with are hilarious and unexpected in all the ways Monikers cards should be hilarious and unexpected. Its sort of uncanny.And if you have never heard of Monikers, the rules are really simple: get your friends to guess the name on a card. The twist is that you play over three rounds, and each time, you have to give clues in different ways. So in the 1st round, you can say or do anything. In the 2nd, you can only use one word. And in the 3rd, you can only do charades.The same cards are used in each round, so by the end of the game you have made up a bunch of silly jokes together.','2016-03-15','2017-08-08',1000,500);
INSERT INTO Projects (project_id,title,creator,img_src,description,start_date,end_date,goal,raised) VALUES (DEFAULT,'Dinosaur Island','damonkidd@quistristique.com','https://s3-ap-southeast-1.amazonaws.com/cs2102jan17g11-crowdfundme/Dinosaur+Island.png','Dinosaur Island is a hot new game from designers Jon Gilmour (Dead of Winter, Wasteland Express Delivery Service) and Brian Lewis (Titans of Industry) from Pandasaurus Games (Machi Koro, Yedo, Wasteland Express Delivery Service) with amazing, technicolor, ridiculously 90s artwork from Kwanchai Moriya and Peter Wocken. 1-4 Players; 60-150 minutes (scalable length regardless of player count), ages 10+. In Dinosaur Island, players will have to collect DNA, research the DNA sequences of extinct dinosaur species and then combine the ancient DNA in the correct sequence to bring these prehistoric creatures back to life.  Dino cooking!  All players will compete to build the most thrilling park each season, and then work to attract (and keep alive!) the most guests each season that the park opens. ','2016-08-31','2017-09-02',5000,2000);
INSERT INTO Projects (project_id,title,creator,img_src,description,start_date,end_date,goal,raised) VALUES (DEFAULT,'LAB-BOX','damonkidd@quistristique.com','https://s3-ap-southeast-1.amazonaws.com/cs2102jan17g11-crowdfundme/Lab-box.png','Interest in analog photography is growing. New generations of digital natives are rediscovering the analogue process as something new to experiment with. This is why we have decided to create a product that would easily allow anyone to develop ?lm rolls in full daylight, indoor or outdoors.LAB-BOX is the only tank of its kind on the market, and is the result of long research and developing efforts, paired with an effective and beautiful design.','2016-09-30','2017-08-26',80000,20000);
INSERT INTO Projects (project_id,title,creator,img_src,description,start_date,end_date,goal,raised) VALUES (DEFAULT,'SnapPower SwitchLight','axelray@egetvolutpatornare.ca','https://s3-ap-southeast-1.amazonaws.com/cs2102jan17g11-crowdfundme/SnapPower.png','The SnapPower SwitchLight is a light switch cover that doubles as a night light. It installs in seconds with no wiring needed! Because we have successfully gone through the Kickstarter process with other projects, we have a very sound understanding of what it takes to run a successful Kickstarter campaign and to deliver on time.We have spent a lot of time designing the SnapPower SwitchLight to meet the highest standards of performance, durability, and convenience. Weve set up our manufacturing facilities and production tooling, and have already produced several thousand SwitchLights to ensure quality.','2015-06-10','2018-04-28',90000,10000);
INSERT INTO Projects (project_id,title,creator,img_src,description,start_date,end_date,goal,raised) VALUES (DEFAULT,'Acteon Compression Packing Cubes','axelray@egetvolutpatornare.ca','https://s3-ap-southeast-1.amazonaws.com/cs2102jan17g11-crowdfundme/Acteon+Compression.png','The struggle of keeping clean and dirty clothes separate disappears when using our packing cubes.  We engineered a gusseted divider between compartments that keeps clean clothes fresh by isolating them from worn smelly clothes.  This works pretty simply.  Start out your trip with all of your clothing on the clean side.  As your clothes get dirty, you move them one by one to the dirty side to keep them separated.  The expandable center divider transfers space from the clean side to the dirty side while not increasing the overall size of the packing cube.  In storing clothes separately, you can easily travel to multiple locations without worry. This also greatly simplifies unpacking.','2016-11-24','2017-11-11',15000,1000);
INSERT INTO Projects (project_id,title,creator,img_src,description,start_date,end_date,goal,raised) VALUES (DEFAULT,'MOKURU Toy','celestedotson@nonhendrerit.edu','https://s3-ap-southeast-1.amazonaws.com/cs2102jan17g11-crowdfundme/mokuru+desk+toy.png','MOKURU is an amazing desk toy crafted with quality beech wood. It has a simple design with endless possibilities that will test your creativity and dexterity. Play with MOKURU for fun or sharpen your skills and style to become a master. You can even play MOKURU with friends. It’s totally up to you. The Basic Level is simple. Tip MOKURU over gently, and it will flip. Once you get the hang of it, you can get creative and start inventing your own unique tricks.','2015-10-26','2017-05-19',15000,2000);
INSERT INTO Projects (project_id,title,creator,img_src,description,start_date,end_date,goal,raised) VALUES (DEFAULT,'SELFLY Camera','garrisondavis@a.net','https://s3-ap-southeast-1.amazonaws.com/cs2102jan17g11-crowdfundme/SELFLY+camera.png','An autonomous flying phone case camera which is only 9mm (3/8in) thin and easily fits in your pocket.','2016-02-06','2017-09-19',50000,2000);
INSERT INTO Projects (project_id,title,creator,img_src,description,start_date,end_date,goal,raised) VALUES (DEFAULT,'ZEROHOUR REBEL: EDC Microlight Flashlight','garrisondavis@a.net','https://s3-ap-southeast-1.amazonaws.com/cs2102jan17g11-crowdfundme/Zerohour+Reber+Microlight.png','Everyday carry meets everyday fun. Ultrathin spinner with dual LED microlight flashlights, ceramic bearing, and fidget-friendly body.Set REBEL on a flat surface and it operates like a mini-lantern. Able to light most rooms, it keeps you safe during a power outage without draining your phone battery. The microlights use standard CR1620 batteries, which are easily removable and replaceable. The button lights securely push into the spinner housing, and detach for use separately as well. You can even flip the lights so they shine out from each side of REBEL.','2015-03-19','2017-05-02',70000,20000);
INSERT INTO Projects (project_id,title,creator,img_src,description,start_date,end_date,goal,raised) VALUES (DEFAULT,'EAROS: In-Ear Protection Solution','prescottpowell@velitdui.com','https://s3-ap-southeast-1.amazonaws.com/cs2102jan17g11-crowdfundme/Earos.png','Music lovers often feel as if they have to choose between protecting their ears and enjoying the full range of acoustics at a concert or club. But what if you could enjoy the full spectrum of sound at reduced decibel levels? With the future of music in mind, we created a revolutionary in-ear protection solution that is designed to allow good sound in, while keeping damaging sound out. Say goodbye to harmful levels of noise with no distortion of sound or quality. Using high quality medical grade composite plastics instead of traditional foam, EAROS ONE filters and reduces sound levels using its patent pending Soundbore design. The full spectrum of sound passes through to your inner ear but at reduced decibel levels, protecting your sensitive hearing from accumulating damage and even hearing loss.','2017-01-29','2017-12-06',100000,20000);
INSERT INTO Projects (project_id,title,creator,img_src,description,start_date,end_date,goal,raised) VALUES (DEFAULT,'TAB-The Adjustable Bag','prescottpowell@velitdui.com','https://s3-ap-southeast-1.amazonaws.com/cs2102jan17g11-crowdfundme/Tab+Adjustable+Bag.png','With 3 sizes and 12 configurations, TAB is the only bag you need. You will never have to go through the hassle of switching between different bags again. TAB can instantly expand or contract to fit what you need, has multiple configurations, and is completely collapsable.','2016-02-11','2017-10-02',30000,5000);
INSERT INTO Projects (project_id,title,creator,img_src,description,start_date,end_date,goal,raised) VALUES (DEFAULT,'Steadicam Volt Smartphone Stabilizer','lewisblackburn@arcuAliquamultrices.org','https://s3-ap-southeast-1.amazonaws.com/cs2102jan17g11-crowdfundme/Steadicam.png','Steadicam, the original camera stabilization choice of Hollywood, is proud to introduce the Steadicam Volt. For the last 40 years Steadicam has given filmmakers the ability to capture smooth and shake free video, allowing them to create some of the worlds most outstanding content.With the advancements in technology and the every day use of our smartphones, we took our Academy Award Winning Steadicam Stabilizing technology and have now put it in the palm of your hand. By using the Steadicam Volt you too will have the ability to capture memorable moments professionally and right from your smartphone!','2016-09-29','2017-12-28',100000,50000);
INSERT INTO Projects (project_id,title,creator,img_src,description,start_date,end_date,goal,raised) VALUES (DEFAULT,'Macchina','lewisblackburn@arcuAliquamultrices.org','https://s3-ap-southeast-1.amazonaws.com/cs2102jan17g11-crowdfundme/Machina.png','M2 by Macchina is an open source automotive interface that can take your car to the next level. Use it to unlock your cars potential or as a development platform for your next product.M2 has the protocols and libraries to work with any car that is not older than Google.M2 is based on the Arduino Due. If you have any previous experience with the Arduino platform, you can leverage existing code, libraries, tutorials, and established communities. But do not worry if you do not - this is a fantastic development platform built for newcomers and professionals alike.','2016-01-13','2017-07-25',50000,10000);
INSERT INTO Projects (project_id,title,creator,img_src,description,start_date,end_date,goal,raised) VALUES (DEFAULT,'Foxshot','amberhobbs@Etiam.com','https://s3-ap-southeast-1.amazonaws.com/cs2102jan17g11-crowdfundme/Foxshot+camera.png','Foxshot is a household camera that once purchased you can use for lifetime and no need to pay extra fee. Fine characters, practical functions and an affordable price. From now on, forget GoPro, forget DropCam, forget your selfie stick since Foxshot is totally competent. Foxshot is a small water-resistant camera that can be placed anywhere. The back of the camera can be firmly attached to glass, wood, screen and even marble. With sophisticated design the Foxshot is water-resistant, so no need to worry about the daily water spattering problem. The replaceable surface makes Foxshot easy to hide in the shooting environment. Not easy to be found and more vivid and natural to record every moment of life. The noise-cancelling microphone can help to restore the shooting scene more realistically.','2015-08-11','2017-07-04',10000,2500);
INSERT INTO Projects (project_id,title,creator,img_src,description,start_date,end_date,goal,raised) VALUES (DEFAULT,'Intelligent Security: Camera Cover','amberhobbs@Etiam.com','https://s3-ap-southeast-1.amazonaws.com/cs2102jan17g11-crowdfundme/Intelligent+security+camera+cover.png','Millions of people use devices with cameras every day! Cameras are found everywhere, on mobile devices, smartphones, tablets, laptops and all-in-one desktops. People depend on cameras to record and share information. In todays connected world people more and more need to protect their privacy! This is why Intelligent Security spent the last year developing the ultimate solution to web camera espionage. It is the worlds thinnest, most ergonomic and seamless mechanical webcam privacy cover. Designed for people who like to have more privacy, security and peace of mind when using smartphones, tablets and computers! Super thin, it is 0.70mm in total thickness, making it the thinnest mechanical webcam privacy cover in the world! Our patent pending super lightweight design was engineered to allow for a seamless fit on a wide range of smartphones, tablets, laptops and all-in-one desktops. The product consists of two parts, a low carbon steel ring with advanced adhesive and a custom neodymium magnetic disc. The ring sticks to your device with the adhesive and the disc attaches to the ring magnetically.','2015-09-15','2018-02-17',6000,2000);
INSERT INTO Projects (project_id,title,creator,img_src,description,start_date,end_date,goal,raised) VALUES (DEFAULT,'Braeon: Strong and Adaptable material','ryderballard@mattisvelit.org','https://s3-ap-southeast-1.amazonaws.com/cs2102jan17g11-crowdfundme/Braeon+material.png','Braeon is a high strength, lightweight plastic ribbon that molecularly fuses to itself in a matter of seconds. Simply heat, press and repeat to form the plastic into any desired shape. Once cooled, the self-bonding plastic hardens, creating a bond as strong as steel. A lighter and more versatile alternative to rope, Braeons patent pending design is a staple for all outdoor enthusiasts and has a place in every kitchen drawer, tool box and backpack. Create custom grips, handles, and harnesses in seconds. Tow equipment, gear and toys with ease. Brave every adventure with Braeon.','2017-01-14','2017-08-04',50000,25000);
INSERT INTO Projects (project_id,title,creator,img_src,description,start_date,end_date,goal,raised) VALUES (DEFAULT,'TheTsunami App','ryderballard@mattisvelit.org','https://s3-ap-southeast-1.amazonaws.com/cs2102jan17g11-crowdfundme/Tsunami+App.png','In the past, emergency service personnel have struggled to find people who have survived floods and other disasters. Our app will allow users to send an emergency signal with the click of a button. All nearby emergency professionals will be alerted to the user’s exact location. The technology we are relying on will work even when GPS and GPRS signals and smartphone batteries are at their weakest. During periods when mobile internet connectivity is limited, users can navigate their way to safety using the compass function built into our app. We’ll alert users as soon as they’ve reached the safe zone TheTsunami app is ready from the clients side. All we need now to make it work properly is to gather the funds required to fine-tune the server with the flooding prediction model for each user and to gain secure access to the buoy network. We are also in negotiations with several charitable foundations to sponsor the app so as to make it free for end users or as cheap as possible. Our main goal is to save as many lives as possible, but in order to provide each individual with a personal rescue plan, our server expenses will be enormous, so we have to raise funds either via subscription fees, or via charitable donations.','2016-05-02','2017-07-22',55000,19800);
INSERT INTO Projects (project_id,title,creator,img_src,description,start_date,end_date,goal,raised) VALUES (DEFAULT,'The Smartest Dog tracker','miriamkaufman@cubilia.co.uk','https://s3-ap-southeast-1.amazonaws.com/cs2102jan17g11-crowdfundme/Smart+Dog+tracker.png','We are dog owners ourselves, and appreciate that no-one knows our pets better than we do. But would not it be great to know how they are when you are not with them. The smart dog collar device tracks your dog’s behavior and activity, and shares updates with you directly through the companion app. Unlike other smart devices for dogs, the device attaches to your dogs collar and transforms it into a smart collar. you will need to pair the device with the smartphone app, available on iOS and Android. We will then ask you a few questions through the app to get to know your dog - such as age, type, weight and normal food intake. This information is then put into our welfare algorithm and we will start monitoring your dogs activity and health. Once the app has this data, your dog behavior and well-being is compared with similar dogs in our database. This allows you spot anything out of the ordinary and react immediately. ','2017-02-20','2017-12-31',50000,23400);
